import React from 'react';

const FixedCosts = ({ fixedCosts, handleInputChange }) => {
    return (
        <div id="gastofixo" className="gastofixo">
            <h2>Gastos fixos</h2>

            <p>Parcela do carro</p>
            <input 
                id="parcelacarro" 
                className="parcelacarro" 
                type="number" 
                value={fixedCosts.parcelacarro} 
                onChange={handleInputChange} 
            />

            <p>IPVA</p>
            <input 
                type="number" 
                id="ipva" 
                className="ipva" 
                value={fixedCosts.ipva} 
                onChange={handleInputChange} 
            />

            <p>Seguro</p>
            <input 
                type="number" 
                id="seguro" 
                className="seguro" 
                value={fixedCosts.seguro} 
                onChange={handleInputChange} 
            />
        </div>
    );
};

export default FixedCosts;
